    if(favApp === "Naukri"){
        return <Naukri />
    
    }
    else{
        return(
            <Card 
            key ={Sdata[2].id}
            imgsrc={Sdata[2].imgsrc}
            title ={Sdata[2].title} 
            sname ={Sdata[2].sname} 
            href = {Sdata[2].href} />
            );
    
    }

};

const Ifelse = () => (
  <>
